That’s a wrap on Pensacola Beach! Gosh it was so much fun and I hated to leave. We had some gorgeous weather today!
Here’s a recap of places we ate that I highly recommend:
The Oar House on the bay.
@bodaciousshops for brunch.
@jacosbayfront was the best meal I have had in a long time! Right on the water!
@rubyslippercafe for brunch right off Palafox in the Village. 
All gluten free friendly places.

Next stop 🚘 Kentucky for a turkey hunt! 

